window.bookSummaryJSON = "<p><b>From </b><b><i>USA Today</i></b><b> best-selling author Rina Kent comes a new stand-alone dark romance about a villain and his new obsession.</b></p> <p>I caught the attention of a monster.</p> <p>I didn’t ask for it. Didn’t even see it coming.</p> <p>But the moment I do, it’s too late.</p> <p>Killian Carson is a predator wrapped in sophisticated charm.</p> <p>He’s cold-blooded, manipulative, and savage.</p> <p>The worst part is that no one sees his devil side.</p> <p>I do.</p> <p>And that will cost me everything.</p> <p>I run, but the thing about monsters?</p> <p>They always chase.</p> <p><i>This book is a dark unconventional romance and contains themes that aren't to everyone's liking. Please check the author's note in the ebook for content warnings before listening.</i></p>"; 
